function createSVGPolygons(data)
	local result = {}
	local shapes = util.from_json(data)
	
	for i,feature in pairs(shapes.features) do
		local newObj = {}
		newObj.name = feature.properties.name
		newObj.points = {}
		newObj.hits = 0
		newObj.isPinned = false		
		newObj.color = '#F5D5C0'
		
		
		local poly = {}
		--read point data and create polygons
		for j,point in pairs(feature.geometry.coordinates[1][1]) do
			local newPoint = convert(point[1],point[2])
			newPoint.ax, newPoint.ay = point[1],point[2]
			table.insert(newObj.points,newPoint)
		end
		
		
		
		table.insert(result,newObj)
		
	end
	return result
end

