function convert(lat,long,radius,color)
	return {
		x= 50+(lat-offsets.x)/zoom,
		y=750-((long-offsets.y)/zoom),
		color = color or '#0000FF',
		radius = radius or 2
		}
end

function rgbToHex(rgb)
	local hexadecimal = '#'

	for key, value in pairs(rgb) do
		local hex = ''

		while(value > 0)do
			local index = math.fmod(value, 16) + 1
			value = math.floor(value / 16)
			hex = string.sub('0123456789ABCDEF', index, index) .. hex			
		end

		if(string.len(hex) == 0)then
			hex = '00'

		elseif(string.len(hex) == 1)then
			hex = '0' .. hex
		end

		hexadecimal = hexadecimal .. hex
	end

	return hexadecimal
end

function fromData(data)
	local identifier = ';'
	local rows = {}
	local result = {}
	local longs = {}
	local lats = {}
	local target = longs
	for match in data:gmatch("([^;%s]+)") do
		local number = tonumber(match) or 0
		if number == 0 then
			--wtf even
		elseif number > 49 then
			table.insert(longs,number)
		else
			table.insert(lats,number)
		end
	end
	
	for i,point in ipairs(longs) do
		table.insert(result,{
			y=point,
			x=lats[i]
			})
	end
	
	return result
end

